import React, { useState } from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import MenuItem from '@material-ui/core/MenuItem';
import Checkbox from '@material-ui/core/Checkbox';
import { Grid } from '@material-ui/core';
import FormControlLabel from '@material-ui/core/FormControlLabel';

const datatypes = [
    "string",
    "number",
    "date"
]

export default function DefineColumnDialog(props) {
    const { open, onSubmit, handleClose } = props
    const [dataType, setDataType] = useState(datatypes[0])
    const [nullable, setNullable] = useState(true)

    return (
        <div>
            <Dialog
                open={open}
                onClose={handleClose}
                aria-labelledby="form-dialog-title"
                fullWidth
                fullHeight
            >

                <DialogTitle id="form-dialog-title">Define Column</DialogTitle>
                <DialogContent>
                    <Grid container direction="column" spacing={3}>
                        <DialogContentText>
                            Define the column by entering the fields below.
                    </DialogContentText>
                        <Grid item>
                            <TextField
                                autoFocus
                                margin="dense"
                                id="name"
                                required
                                label="Column name"
                                fullWidth
                            />
                        </Grid>
                        <Grid item>
                            <TextField
                                id="datatype"
                                select
                                required
                                label="Datatype"
                                value={dataType}
                                onChange={(e) => setDataType(e.target.value)}
                            >
                                {datatypes.map((option) => (
                                    <MenuItem key={option} value={option}>
                                        {option}
                                    </MenuItem>
                                ))}
                            </TextField>
                        </Grid>
                        <Grid item>
                            <FormControlLabel
                                label="Nullable"
                                control={
                                    <Checkbox
                                        checked={nullable}
                                        onChange={(e) => setNullable(e.target.checked)}
                                        name="nullable"
                                        color="primary"
                                    />
                                }

                            />
                        </Grid>
                    </Grid>
                </DialogContent>


                <DialogActions>
                    <Button onClick={handleClose} color="primary">
                        Cancel
          </Button>
                    <Button onClick={handleClose} color="primary">
                        Subscribe
          </Button>
                </DialogActions>
            </Dialog>
        </div>
    );
}
